import React, {useEffect} from 'react';
import {useParams} from "react-router-dom";
import {fetchRoutines, fetchRoutineActivities } from '../api';

const Routines = (props) => {
    const { routines , setRoutines, activities, setActivities } = props;
    // const [routines, setRoutines] = useState([])

    useEffect( () => {
        fetchRoutines().then(setRoutines)
        console.log('routines', routines);
    },[])

    useEffect( () => {
        const {activityId} = useParams();
        fetchRoutineActivities(activityId).then(setActivities)
        console.log('routines', activities);
    },[])



    return (<>
    { routines && routines.map(({activities, id, creatorId, creatorName, isPublic, name, goal}) => 
    <div key={id}
    className="row">
    <div className="col-sm-6">
      <div className="card">
        <div className="card-body">
          <h5 className="card-title">{name}</h5>
          <p className="card-text">By {creatorName}</p>
          <p className="card-text">Goal: {goal}</p>
          {activities.map((activity) => {
              return <div key={activity.id} className="card" style="width: 18rem;">
                    <div className="card-body">
                        <h5 className="card-title">{activity.name}</h5>
                        <p className="card-text">{activity.description}</p>
                    </div>
                </div>


          })}
          <p className="card-text">Activities: {goal}</p>
          <a href="#" className="btn btn-primary">Go somewhere</a>
        </div>
      </div>
    </div>
  </div>
    )}
    </>)
};

export default Routines;

